// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v4.8.0/contracts/access/Ownable.sol";

/**
 * @dev Interface for CourseToken with enumeration support.
 * It includes functions for token ownership, transfers, and course details.
 */
interface ICourseTokenEnumerable {
    function ownerOf(uint256 tokenId) external view returns (address);
    function safeTransferFrom(address from, address to, uint256 tokenId) external;
    function courseDetails(uint256 tokenId)
        external
        view
        returns (string memory, string memory, string memory, string memory);
    function balanceOf(address owner) external view returns (uint256);
    function tokenOfOwnerByIndex(address owner, uint256 index) external view returns (uint256);
}

contract Swap is Ownable {
    struct Order {
        uint256 orderId;
        address student;
        uint256 offeredTokenId;
        string requestedCourseID;
        bool active;
    }

    struct OrderWithMetadata {
        uint256 orderId;
        address student;
        uint256 offeredTokenId;
        string requestedCourseID;
        string courseID;
        string preceptID;
        string timing;
        string coursePageURL;
    }

    ICourseTokenEnumerable public courseToken;
    uint256 public orderCounter;
    mapping(uint256 => Order) public orders;
    uint256[] public orderIds;

    event OrderSubmitted(uint256 orderId, address indexed student, uint256 offeredTokenId, string requestedCourseID);
    event OrderCancelled(uint256 orderId, address indexed student);
    event SwapExecuted(uint256 orderId1, uint256 orderId2, uint256 tokenId1, uint256 tokenId2);

    event SwapExecutedVerbose(
        uint256 orderId1,
        address student1,
        string courseID1,
        string preceptID1,
        uint256 orderId2,
        address student2,
        string courseID2,
        string preceptID2
    );

    constructor(address _courseTokenAddress) Ownable() {
        courseToken = ICourseTokenEnumerable(_courseTokenAddress);
    }

    function submitOrder(uint256 offeredTokenId, string memory requestedCourseID) public {
        require(courseToken.ownerOf(offeredTokenId) == msg.sender, "You do not own the offered token");
        orderCounter++;
        orders[orderCounter] = Order(orderCounter, msg.sender, offeredTokenId, requestedCourseID, true);
        orderIds.push(orderCounter);
        emit OrderSubmitted(orderCounter, msg.sender, offeredTokenId, requestedCourseID);
    }

    function cancelOrder(uint256 orderId) public {
        Order storage order = orders[orderId];
        require(order.active, "Order is not active");
        require(order.student == msg.sender, "Not your order");
        order.active = false;
        emit OrderCancelled(orderId, msg.sender);
    }

    function cancelAllOrders() public onlyOwner {
        for (uint256 i = 0; i < orderIds.length; i++) {
            uint256 orderId = orderIds[i];
            if (orders[orderId].active) {
                orders[orderId].active = false;
                emit OrderCancelled(orderId, orders[orderId].student);
            }
        }
    }

    function getActiveOrdersWithMetadata() public view onlyOwner returns (OrderWithMetadata[] memory) {
        uint256 count = 0;
        for (uint256 i = 0; i < orderIds.length; i++) {
            if (orders[orderIds[i]].active) {
                count++;
            }
        }

        OrderWithMetadata[] memory results = new OrderWithMetadata[](count);
        uint256 index = 0;

        for (uint256 i = 0; i < orderIds.length; i++) {
            uint256 orderId = orderIds[i];
            if (orders[orderId].active) {
                Order storage order = orders[orderId];
                (
                    string memory courseID,
                    string memory preceptID,
                    string memory timing,
                    string memory coursePageURL
                ) = courseToken.courseDetails(order.offeredTokenId);

                results[index] = OrderWithMetadata(
                    order.orderId,
                    order.student,
                    order.offeredTokenId,
                    order.requestedCourseID,
                    courseID,
                    preceptID,
                    timing,
                    coursePageURL
                );
                index++;
            }
        }

        return results;
    }

    function executeSwaps() public onlyOwner {
        uint256 n = orderIds.length;

        for (uint256 i = 0; i < n; i++) {
            uint256 orderId1 = orderIds[i];
            if (!orders[orderId1].active) continue;

            Order storage order1 = orders[orderId1];
            (string memory courseID1, , , ) = courseToken.courseDetails(order1.offeredTokenId);

            for (uint256 j = i + 1; j < n; j++) {
                uint256 orderId2 = orderIds[j];
                if (!orders[orderId2].active) continue;

                Order storage order2 = orders[orderId2];
                (string memory courseID2, , , ) = courseToken.courseDetails(order2.offeredTokenId);

                if (
                    compareStrings(order1.requestedCourseID, courseID2) &&
                    compareStrings(order2.requestedCourseID, courseID1)
                ) {
                    address student1 = order1.student;
                    address student2 = order2.student;
                    uint256 tokenId1 = order1.offeredTokenId;
                    uint256 tokenId2 = order2.offeredTokenId;

                    require(courseToken.ownerOf(tokenId1) == student1, "Owner mismatch for token 1");
                    require(courseToken.ownerOf(tokenId2) == student2, "Owner mismatch for token 2");

                    if (
                        hasTimingConflict(student1, tokenId1, tokenId2) ||
                        hasTimingConflict(student2, tokenId2, tokenId1) ||
                        hasCourseConflict(student1, tokenId1, tokenId2) ||
                        hasCourseConflict(student2, tokenId2, tokenId1)
                    ) {
                        continue;
                    }

                    courseToken.safeTransferFrom(student1, student2, tokenId1);
                    courseToken.safeTransferFrom(student2, student1, tokenId2);

                    order1.active = false;
                    order2.active = false;

                    emit SwapExecuted(orderId1, orderId2, tokenId1, tokenId2);

                    {
                        // Scoped block to avoid stack limit
                        (string memory c1, string memory p1, , ) = courseToken.courseDetails(tokenId1);
                        (string memory c2, string memory p2, , ) = courseToken.courseDetails(tokenId2);
                        emit SwapExecutedVerbose(orderId1, student1, c1, p1, orderId2, student2, c2, p2);
                    }

                    break; // Exit inner loop
                }
            }
        }
    }

    function getTokensOfOwner(address owner) internal view returns (uint256[] memory) {
        uint256 count = courseToken.balanceOf(owner);
        uint256[] memory tokens = new uint256[](count);
        for (uint256 i = 0; i < count; i++) {
            tokens[i] = courseToken.tokenOfOwnerByIndex(owner, i);
        }
        return tokens;
    }

    function hasTimingConflict(address student, uint256 droppingTokenId, uint256 incomingTokenId) internal view returns (bool) {
        uint256[] memory regs = getTokensOfOwner(student);
        (, , string memory incomingTiming, ) = courseToken.courseDetails(incomingTokenId);
        for (uint256 i = 0; i < regs.length; i++) {
            if (regs[i] == droppingTokenId) {
                continue;
            }
            (, , string memory regTiming, ) = courseToken.courseDetails(regs[i]);
            if (compareStrings(regTiming, incomingTiming)) {
                return true;
            }
        }
        return false;
    }

    function hasCourseConflict(address student, uint256 droppingTokenId, uint256 incomingTokenId) internal view returns (bool) {
        uint256[] memory regs = getTokensOfOwner(student);
        (string memory incomingCourseID, , , ) = courseToken.courseDetails(incomingTokenId);
        for (uint256 i = 0; i < regs.length; i++) {
            if (regs[i] == droppingTokenId) {
                continue;
            }
            (string memory regCourseID, , , ) = courseToken.courseDetails(regs[i]);
            if (compareStrings(regCourseID, incomingCourseID)) {
                return true;
            }
        }
        return false;
    }

    function compareStrings(string memory a, string memory b) internal pure returns (bool) {
        return (keccak256(abi.encodePacked(a)) == keccak256(abi.encodePacked(b)));
    }
}

